import React from "react";

const AdvancedCalculator = ({ onButtonClick }) => {
  const buttons = [
    "1",
    "2",
    "3",
    "+",
    "-",
    "4",
    "5",
    "6",
    "*",
    "/",
    "7",
    "8",
    "9",
    "^",
    "=",
    "0",
    "(",
    ")",
    "x",
    "y",
    "z",
    "sin",
    "cos",
    "tan",
    "log",
    "ln",
    "√",
    "π",
    "e",
    "^2",
    "^3",
    "Backspace",
  ];

  return (
    <div style={{ display: "flex", flexWrap: "wrap", maxWidth: "350px" }}>
      {buttons.map((button) => (
        <button
          key={button}
          onClick={() => onButtonClick(button)}
          style={{ width: "50px", height: "40px", margin: "5px" }}
        >
          {button}
        </button>
      ))}
    </div>
  );
};

export default AdvancedCalculator;
